import { styled } from 'baseui';

const Wrapper = styled('form', {
  position: 'relative',
});

export const Send = styled('div', {
  paddingLeft: '16px',
  paddingRight: '16px',
  display: 'flex',
  alignItems: 'center',
  justifyContent: 'center',
  cursor: 'pointer',
});

export default Wrapper;
